import Block from "../main_Block/Block.jsx";
import "./Main.scss";

const loremString = `Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod`
const textArray = [loremString,loremString,loremString, loremString]
const titelArray = ["Brand Identity","Marketing", "Illustration", "Web Design"]

// Obj Bauplan
class ObjBauplan {
    constructor(titel, text) {
        this.titel = titel
        this.text = text
    }
    description() {
        console.log(this.titel, this.text)
    }
}

// Obj erstellen und mit Arrays befüllen
const obj_befüllt = [];
for (let i = 0; i < textArray.length; i++){
    const obj_i_runden = new ObjBauplan(titelArray[i], textArray[i])
    console.log(obj_i_runden)
    obj_befüllt.push(obj_i_runden)
}
console.log(obj_befüllt)


// Block befüllen lassen
const blocks_Html = [];
for (let i = 0 ; i < obj_befüllt.length; i++){
    const block = <Block> title={obj_befüllt[i].titel} text={obj_befüllt[i].text}</Block>
    blocks_Html.push(block)
};

const Main = () => {
    return (
        <section className="Main_Section">
            <h3>What We Do</h3>
            <h2>We've got everything you need to launch and grow your business</h2>

            <article>



                <Block title={obj_befüllt[0].titel} text="lorem"></Block>
            </article>
        </section>
    );
}

export default Main;
